function ChatBot() {
  return (
    <div>
      <div className="row">
        <h1>Coach Greg</h1>

        <div></div>

        <div className="row">
          <div class="input-group">
            <span class="input-group-text text-right">With textarea</span>
            <textarea
              class="form-control"
              aria-label="Send"
            ></textarea>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ChatBot;
